import React, { Component } from 'react';
import { StyleSheet, View, Text } from 'react-native';

import * as firebase from 'firebase';

import * as Font from 'expo-font';
import { Card, CardItem, Thumbnail, Body, Left, Right, Button, Icon } from 'native-base';

const firebaseConfig = {
    apiKey: "AIzaSyB_adGJvPIMiFnJmLdUQuQ8ln5gP-PZTgY",
    authDomain: "cowel-c35ee.firebaseapp.com",
    databaseURL: "https://cowel-c35ee.firebaseio.com",
    projectId: "cowel-c35ee",
    storageBucket: "cowel-c35ee.appspot.com",
    messagingSenderId: "697234973847",
    appId: "1:697234973847:web:7248bf71be59e2da7b75d2",
    measurementId: "G-DK8XDQBP2M"
};

const databaseURL = "https://cowel-c35ee.firebaseio.com";
if (!firebase.apps.length) {
    firebase.initializeApp(firebaseConfig);
}

export const googleProvider = new firebase.auth.GoogleAuthProvider();

export const database = firebase.database()
export const auth = firebase.auth();

database.ref('/').on('value', (snapshot) => {
    console.log(snapshot.val())
})

export default class MainScreen extends Component {
    state = { currentUser: null }
    componentDidMount() {
        const { currentUser } = firebase.auth()
        this.setState({ currentUser })
    }

    constructor(props) {
        super(props);

        this.state = { isReady: false };
    }

    async componentDidMount() {

        await Font.loadAsync({
            'Cafe24Ohsquare': require('../assets/fonts/Cafe24Ohsquare.ttf'),
        });

        this.setState({ isReady: true });
    }

    render() {
        return (
            <View style={styles.container}>
                <Text style={styles.header}>CoWel</Text>
                <View style={styles.secondContainer}>
                    <Card>
                        <CardItem>
                            <Text>
                                wow
                            </Text>
                        </CardItem>
                    </Card>
                </View>
            </View>

        );
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
    },
    header: {
        fontFamily: 'Cafe24Ohsquare',
        padding: 20,
        marginTop: 50,
        fontSize: 40,
        color: 'tomato'

    },
    secondContainer: {
        flex: 1,
        justifyContent: "space-evenly",
        alignItems: "center"
    }
});
